import { Pagination, Stack } from "@mui/material";
import React from "react";

const style = {
  stack: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      padding: "5%",
  }
};
type RoundedPaginationProps = {
    currentPage: number;
    totalPages: number;
    onPageChange: (page: number) => void;
};

const RoundedPagination: React.FC<RoundedPaginationProps> = ({ currentPage, totalPages, onPageChange }) => {
    const handlePageChange = (event: React.ChangeEvent<unknown>, page: number) => {
        onPageChange(page);
    };

    return (
        <Stack spacing={2} style={style.stack}>
            <Pagination
                count={totalPages}
                page={currentPage}
                shape="rounded"
                color="primary"
                onChange={handlePageChange}
            />
        </Stack>
    );
};

export default RoundedPagination;
